DROP TABLE IF EXISTS `c_order`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `c_order` (
  `id` bigint(16) unsigned NOT NULL AUTO_INCREMENT COMMENT '订单ID',
  `product_id` int(8) NOT NULL COMMENT '商品ID',
  `item_sku_id` int(8) NOT NULL COMMENT '货品ID',
  `shop_id` int(8) NOT NULL COMMENT '经销商ID',
  `city_id` int(8) NOT NULL COMMENT '城市ID',
  `city_name` varchar(20) NOT NULL DEFAULT '' COMMENT '城市名称',
  `user_id` int(8) NOT NULL COMMENT '用户ID',
  `product_name` varchar(64) NOT NULL DEFAULT '' COMMENT '商品名称',
  `user_name` varchar(64) NOT NULL DEFAULT '' COMMENT '客户名称',
  `phone` varchar(32) NOT NULL DEFAULT '' COMMENT '客户电话',
  `car_prices` varchar(256) NOT NULL DEFAULT '' COMMENT 'JSON串，汽车指导价/现价',
  `activity_deposit` bigint(8) NOT NULL DEFAULT '0' COMMENT '活动定金',
  `activity_discount` bigint(8) NOT NULL DEFAULT '0' COMMENT '活动立减金额',
  `buy_count` int(8) NOT NULL DEFAULT '0' COMMENT '购买数量',
  `order_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '订单状态 1: 待支付；2: 已取消；3: 已超时；4: 已支付；5: 已核销；6: 已退款；7: 已结算',
  `create_time` bigint(16) NOT NULL DEFAULT '0' COMMENT '订单创建时间',
  `expire_time` bigint(16) NOT NULL DEFAULT '0' COMMENT '订单超时时间',
  `pay_id` varchar(255) NOT NULL DEFAULT '' COMMENT '支付流水号',
  `pay_time` bigint(16) NOT NULL DEFAULT '0' COMMENT '订单支付时间',
  `pay_amount` bigint(20) NOT NULL DEFAULT '0' COMMENT '支付金额',
  `cancel_time` bigint(16) NOT NULL DEFAULT '0' COMMENT '订单取消时间',
  `coupon_destroy_time` bigint(16) NOT NULL DEFAULT '0' COMMENT '订单核销时间',
  `coupon_code` varchar(64) NOT NULL DEFAULT '' COMMENT '核销码',
  `coupon_expire_time` bigint(20) NOT NULL DEFAULT '0' COMMENT '券过期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=54 DEFAULT CHARSET=utf8 COMMENT='订单表';
