DROP TABLE IF EXISTS `c_product`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `c_product` (
  `id` int(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '商品ID',
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '汽车名称',
  `logo` varchar(256) NOT NULL DEFAULT '' COMMENT '汽车LOGO',
  `icon_url` varchar(255) NOT NULL DEFAULT '' COMMENT 'icon图片',
  `imgs_banner` varchar(1024) NOT NULL DEFAULT '' COMMENT 'JSON串，活动banner图',
  `imgs_details` varchar(1024) NOT NULL DEFAULT '' COMMENT 'JSON串，活动详情图',
  `car_parameters` varchar(1024) NOT NULL DEFAULT '' COMMENT 'JSON串，汽车参数',
  `activity_title` varchar(64) NOT NULL DEFAULT '' COMMENT '活动标题',
  `activity_rules` varchar(4096) NOT NULL DEFAULT '' COMMENT 'JSON串，活动规则',
  `car_prices` varchar(256) NOT NULL DEFAULT '' COMMENT 'JSON串，汽车指导价/现价',
  `activity_deposit` bigint(8) NOT NULL DEFAULT '0' COMMENT '活动定金',
  `product_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态 1：上架； 0：下架',
  `create_time` bigint(16) NOT NULL DEFAULT '0' COMMENT '创建时间',
  `colors` varchar(300) NOT NULL,
  `types` varchar(9000) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='商品表-SPU';
/*!40101 SET character_set_client = @saved_cs_client */;

