CREATE TABLE `mis_index_layout` (
  `id` bigint(16) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `product_id` int(8) NOT NULL DEFAULT '0' COMMENT '商品ID',
  `activity_layout_id` int(8) NOT NULL DEFAULT '0' COMMENT '活动布局表ID',
  `layout_type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '布局类型 1：logo； 2：banner；3：activity；4：recommend；5：contact',
  `source_url` varchar(1024) NOT NULL DEFAULT '' COMMENT '源URL',
  `target_url` varchar(1024) NOT NULL DEFAULT '' COMMENT '目标URL',
  `layout_sort` int(8) NOT NULL DEFAULT '0' COMMENT '布局排序',
  `online_time` bigint(16) NOT NULL DEFAULT '0' COMMENT '上线时间，单位毫秒',
  `display_title` varchar(64) NOT NULL DEFAULT '' COMMENT '商品显示名称',
  `display_subtitle` varchar(128) NOT NULL DEFAULT '' COMMENT '商品显示描述',
  `display_details` varchar(1024) NOT NULL DEFAULT '' COMMENT 'JSON串，商品属性显示',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态 1：有效； 0：无效',
  `create_time` bigint(20) NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 COMMENT='首页布局表';
