--
-- Table structure for table `mis_shop`
--

DROP TABLE IF EXISTS `mis_shop`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `mis_shop` (
  `id` int(8) unsigned NOT NULL AUTO_INCREMENT COMMENT '经销商ID',
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT '经销商名称',
  `address` varchar(256) NOT NULL DEFAULT '' COMMENT '经销商地址',
  `phone` varchar(32) NOT NULL DEFAULT '' COMMENT '经销商电话',
  `longitude` varchar(45) NOT NULL DEFAULT '0' COMMENT '经销商经度',
  `latitude` varchar(45) NOT NULL DEFAULT '0' COMMENT '经销商纬度',
  `province_id` int(8) NOT NULL DEFAULT '0' COMMENT '省ID',
  `province_name` varchar(16) NOT NULL DEFAULT '' COMMENT '省',
  `city_id` int(8) NOT NULL DEFAULT '0' COMMENT '城市ID',
  `city_name` varchar(64) NOT NULL DEFAULT '' COMMENT '城市名称',
  `code` varchar(45) NOT NULL,
  `pre_sales_id` varchar(45) NOT NULL,
  `email` varchar(45) NOT NULL,
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态 0：有效； 1：无效',
  `create_time` bigint(16) NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `LOCATION_INDEX` (`province_id`,`city_id`,`status`)
) ENGINE=InnoDB AUTO_INCREMENT=724 DEFAULT CHARSET=utf8 COMMENT='经销商表';
/*!40101 SET character_set_client = @saved_cs_client */;

